select caa.*,p.P_NAME as PROVINCE_NAME,C_NAME as CITY_NAME,ca.CANAME as SUPER_NAME from t_coop_agency_apply caa LEFT JOIN t_province p ON caa.CAPROVINCE = p.P_ID LEFT JOIN t_city c ON caa.CACITY = c.C_ID LEFT JOIN t_coop_agency ca ON caa.SUPERCODE = ca.CACODE AND ca.`STATUS`='00'
AND caa.CACODE = #{coopAgencyApply.cacode}
AND caa.CANAME = #{coopAgencyApply.caname}
AND caa.SUPERCODE = #{coopAgencyApply.supercode}
And
#{status}
order by SELF_ID DESC
limit #{beginRow},#{pageSize}

